import React from 'react';
import logo from './logo.svg';
import './App.css';
import Main from './Main.js';
import Section6 from './Section6';
import Navbar from './Navbar';
import Click from './click';
import Example from './Example';

function App() {
  return (
    <div className="App">
    <Navbar/>
    <Section6/>
     <Main/>
     <Click/>
     <Example/>
    </div>
  );
}

export default App;
